<script>
    const svg = document.getElementById('svg-map-muni');
    const mapContainer = document.querySelector('.map-wrapper'); // Replace with your map container class or ID

    let scale = 1; // Initial scale
    let zoomSpeed = 0.2; // Increased zoom speed value
    let maxZoomOut = 1; // Maximum limit for zooming out (no zoom out allowed)
    let maxZoomIn = 10; // Maximum limit for zooming in

    // Zoom In
    mapContainer.addEventListener('wheel', (e) => {
        e.preventDefault();
        if (e.deltaY > 0) {
            // Zoom out (decrease scale)
            scale -= zoomSpeed;
        } else {
            // Zoom in (increase scale)
            scale += zoomSpeed;
        }
        scale = Math.min(maxZoomIn, Math.max(1 / maxZoomOut, scale)); // Limit scale within the specified range
        zoomMap();
    });

    // Pan
    let isDragging = false;
    let startPoint = { x: 0, y: 0 };
    let translate = { x: 0, y: 0 };

    mapContainer.addEventListener('mousedown', (e) => {
        // Check if the scale is greater than 1 before allowing panning
        if (scale > 1) {
            isDragging = true;
            startPoint = { x: e.clientX - translate.x, y: e.clientY - translate.y };
            mapContainer.style.cursor = 'grabbing';
        }
    });

    document.addEventListener('mousemove', (e) => {
        if (!isDragging) return;
        const deltaX = e.clientX - startPoint.x;
        const deltaY = e.clientY - startPoint.y;
        translate = { x: deltaX, y: deltaY };
        panMap();
    });

    document.addEventListener('mouseup', () => {
        isDragging = false;
        mapContainer.style.cursor = 'grab';
    });

    function zoomMap() {
        svg.style.transform = `scale(${scale}) translate(${translate.x}px, ${translate.y}px)`;
    }

    function panMap() {
        svg.style.transform = `scale(${scale}) translate(${translate.x}px, ${translate.y}px)`;
    }

</script>